import React, { useContext } from 'react';
import ConfProject from '../../contexts/ConfProject';
import Project from './Project';

import './style.scss';

function Comunity() {
  const { codes } = useContext(ConfProject);
  console.log(codes)

  return (
    <main className="comunity">
      {codes.map((code) => (
        <Project nome={code.nome} descricao={code.descricao} color={code.color} code={code.code} />
      ))}
    </main>
  );
}

export default Comunity
